import React, {useEffect, useState} from "react";
import "./style/style.css";
import moment from "moment";
import {
  RiCheckboxBlankCircleLine,
  RiCheckboxCircleLine,
} from "react-icons/ri";

const Users = ({ users, stateName, country, filter }) => {


  return (
    users.map((user) => {
        return (
            <tr key={user.id + user.registered} >
              <td>{user.fullName}</td>
              <td>{user.balance}</td>
              <td>
                {user.isActive ? (
                  <RiCheckboxCircleLine
                    style={{
                      color: "#3dda33",
                      backgroundColor: "transparent",
                      paddingTop: "5px",
                    }}
                  />
                ) : (
                  <RiCheckboxBlankCircleLine
                    style={{
                      color: "#dc3545",
                      backgroundColor: "transparent",
                      paddingTop: "5px",
                    }}
                  />
                )}
              </td>
              <td>{moment(user.registered).format("LLL")}</td>
              <td>{stateName}</td>
              <td>{country}</td>
            </tr>
        );
      })
  );
};

export default Users;
